import App from "../App";
import {useNavigate} from "react-router-dom";

export default function(){
    let naviget = useNavigate();

    function nhap(){
        if(naviget !== ADMIN && naviget !==ADMIN){
            return "nhập không đúng"
        }
        else{naviget('/Dssp')}
    }

    return (
        <>
            <input type="text" onClick={nhap}/>
        </>
    );
}
